import React from 'react'


const LogoButton = ({ icon, text, link }) => {
  return (
    <a href={link} className={`logo-button ${icon}-icon`} target="_blank" rel="noopener noreferrer">
      <span className="icon">{icon}</span> {text}
    </a>
  );
};

const Contact = () => {
  return (
    <div className="Contact">
      <LogoButton icon="✉️" text="Email" link="mailto:sravanimalla1999@gmail.com" />
      <LogoButton icon="🔗" text="LinkedIn" link="https://www.linkedin.com/in/sravani-malla-1b1497189/" />
    </div>
  );
};

























export default Contact;
